package util;

public class Coordinate {
private double x;
private double y;
public Coordinate(double nextNumber, double nextNumber2) {
	x = nextNumber;
	y = nextNumber2;
}
public Coordinate() {
	// TODO Auto-generated constructor stub
}
public double getX() {
	return x;
}
public void setX(double x) {
	this.x = x;
}
public double getY() {
	return y;
}
public void setY(double y) {
	this.y = y;
}
}
